import React from "react";

const RestaurantCard = ({ restaurant }) => {
  return (
    <div className="bg-white shadow-lg rounded-2xl p-4 w-full hover:scale-105 transition duration-300">
      <img
        src={restaurant.image}
        alt={restaurant.name}
        className="w-full h-48 object-cover rounded-xl"
      />

      <h2 className="text-center font-semibold mt-4 text-xl text-gray-800">
        {restaurant.name}
      </h2>

      <button className="mt-4 w-full bg-purple-700 hover:bg-purple-800 text-white py-2 rounded-xl text-sm">
        VIEW MENU
      </button>
    </div>
  );
};

export default RestaurantCard;
